import matplotlib.pyplot as plt
import numpy as np
import datetime

def getSnapshotNameFull(snapshotName):

    snapshotParts = snapshotName.split('_')

    return snapshotParts[1] + ':' + snapshotParts[2] + ':' + snapshotParts[3] + '-' \
         + snapshotParts[4] + ':' + snapshotParts[5] + ':' + snapshotParts[6]

def getDateStringFromIntervalHead(intervalHead):

    year = '2020'
    month = '01'

    intervalHeadParts = intervalHead.split(':')
    day = intervalHeadParts[0]
    hour = intervalHeadParts[1]

    return year + '-' + month + '-' + day + ' ' + hour

def stringToTimestamp(dateString):
    dateTimeObj = datetime.datetime.strptime(dateString, '%Y-%m-%d %H')
    return int(datetime.datetime.timestamp(dateTimeObj))

def getCurrentTimestampInterval(xValue):
    xValueCurrentInterval = xValue.split('-')[0]
    dateStringCurrentInterval = getDateStringFromIntervalHead(xValueCurrentInterval)
    return stringToTimestamp(dateStringCurrentInterval)

def normalizeXY(xAxis, yAxis, timeStep):

    timestamp2Value = {}

    intervalId = 0

    while intervalId < len(xAxis):
        timestampCurrentInterval = getCurrentTimestampInterval(xAxis[intervalId])
        timestempNextInterval = timestampCurrentInterval + timeStep
        intervalTimeStep = timestampCurrentInterval
        timestamp2Value[intervalTimeStep] = 0

        while(timestampCurrentInterval < timestempNextInterval and intervalId < len(xAxis)):
            timestampCurrentInterval = getCurrentTimestampInterval(xAxis[intervalId])
            timestamp2Value[intervalTimeStep] += yAxis[intervalId]
            intervalId += 1

    xAxis = [datetime.datetime.fromtimestamp(key).strftime('%d-%H') for key in timestamp2Value.keys()]
    yAxis = [item[1] for item in timestamp2Value.items()]

    return (xAxis, yAxis)

def plotGrowth(growthList):

    for dataset in growthList:

        xAxis = [getSnapshotNameFull(term[0]) for term in dataset]
        yAxis = [term[2] for term in dataset]

        xAxis, yAxis = normalizeXY(xAxis, yAxis, 60*60*3)

        plt.xticks(range(len(xAxis)), rotation=90, ha='right', fontsize=10)
        plt.plot(xAxis, yAxis)

def plotGraph(title, xLabel, yLabel):

    plt.title(title)

    plt.xlabel(xLabel)
    plt.ylabel(yLabel)

    plt.show()

